import styled, { keyframes } from 'styled-components';




export const BigText = styled.p`
  text-align: center;
  font-size: 20px;
  margin-top: 50px;
`;

export const LeftSide = styled.div`
  float: left;
`;


export const FacilitiesArea = styled.div`
  border:1px solid red;
  margin:20px;
  padding-left: 20px;
`;
